import Toolbar from '@mui/material/Toolbar';

export const Home=()=>{

  return(

    <Box
        component="main"
        sx={{ flexGrow: 1, p: 3, marginLeft: {  sm: `200px`, md: `200px`}}}>
          {/* sx={{ flexGrow: 1, p: 3,display:'flex'}}>  */}
        <Toolbar />
        <h1>Home</h1>
    </Box>
  )

}
